import React from "react";
import "./Dropdown.css";

const Dropdown = (props) => {
  <div className="dropdown">
    <div className="dropdown-btn">Vortex</div>
    <div className="dropdown-content">
      <div className="dropdown-item">Vortex</div>
      <div className="dropdown-item">Five Jets</div>
    </div>
  </div>;
};

export default Dropdown;
